import React from 'react';

const InstructorProfileSection = ({ user, analytics, courses = [] }) => {
  if (!user || user.role !== 'Instructor') return null;

  return (
    <div className="px-4 py-8 bg-gray-50">
      {/* Instructor Details */}
      <div className="w-full max-w-4xl mx-auto bg-white rounded-xl shadow-md p-6 md:p-8 mb-10">
        <h2 className="text-2xl font-bold text-primary mb-4">👨‍🏫 Instructor Details</h2>
        <div className="grid grid-cols-1 md:grid-cols-2 gap-4 text-sm text-gray-700">
          <div>
            <span className="font-semibold">Email:</span> {user.email}
          </div>
          <div>
            <span className="font-semibold">Earnings:</span> ${analytics?.earnings?.toFixed(2) || '0.00'}
          </div>
          <div className="md:col-span-2">
            <span className="font-semibold">Bio:</span>{' '}
            {user.bio || <span className="text-gray-400 italic">No bio provided</span>}
          </div>
          <div>
            <span className="font-semibold">Joined:</span>{' '}
            {user.createdAt ? new Date(user.createdAt).toLocaleDateString() : '-'}
          </div>
        </div>
      </div>

      {/* Instructor Analytics */}
      <div className="w-full max-w-4xl mx-auto bg-white rounded-xl shadow-md p-6 md:p-8 mb-10">
        <h2 className="text-2xl font-bold text-primary mb-4">📊 Instructor Analytics</h2>
        <div className="grid grid-cols-2 sm:grid-cols-3 md:grid-cols-6 gap-4 text-center">
          <div className="bg-gradient-to-br from-green-100 to-green-200 p-4 rounded-lg shadow">
            <p className="text-xs text-gray-600">Total Earnings</p>
            <p className="text-lg font-bold text-green-800">${analytics?.earnings?.toFixed(2) || '0.00'}</p>
          </div>
          <div className="bg-gradient-to-br from-blue-100 to-blue-200 p-4 rounded-lg shadow">
            <p className="text-xs text-gray-600">Total Enrollments</p>
            <p className="text-lg font-bold text-blue-800">{analytics?.total || 0}</p>
          </div>
          <div className="bg-gradient-to-br from-yellow-100 to-yellow-200 p-4 rounded-lg shadow">
            <p className="text-xs text-gray-600">Paid Enrollments</p>
            <p className="text-lg font-bold text-yellow-800">{analytics?.paid || 0}</p>
          </div>
          <div className="bg-gradient-to-br from-red-100 to-red-200 p-4 rounded-lg shadow">
            <p className="text-xs text-gray-600">Free Enrollments</p>
            <p className="text-lg font-bold text-red-800">{analytics?.free || 0}</p>
          </div>
          <div className="bg-gradient-to-br from-indigo-100 to-indigo-200 p-4 rounded-lg shadow col-span-2 sm:col-span-1">
            <p className="text-xs text-gray-600">Total Courses</p>
            <p className="text-lg font-bold text-indigo-800">{analytics?.courses || 0}</p>
          </div>
        </div>
      </div>

      {/* Created Courses */}
      <div className="w-full max-w-4xl mx-auto mb-16">
        <h2 className="text-2xl font-bold text-primary mb-6">📚 Created Courses</h2>
        {courses.length > 0 ? (
          <div className="grid grid-cols-1 sm:grid-cols-2 gap-6">
            {courses.map((course) => (
              <div key={course._id} className="bg-white p-4 rounded-xl shadow-md hover:shadow-lg transition">
                <h3 className="text-lg font-semibold text-gray-800 mb-1 truncate">{course.title}</h3>
                <p className="text-sm text-gray-600">{course.description.slice(0, 80)}...</p>
                <div className="mt-3 text-xs text-gray-500 flex justify-between">
                  <span>Category: {course.category}</span>
                  <span>${course.price.toFixed(2)}</span>
                </div>
              </div>
            ))}
          </div>
        ) : (
          <p className="text-gray-600 italic">No courses created yet.</p>
        )}
      </div>
    </div>
  );
};

export default InstructorProfileSection;
